import { Component } from "react";
import ProductMedia from "../Snippets/ProductMedia";
import ProductMeta from "../Snippets/ProductMeta";
import ReviewsGrid from '../Global/ReviewsGrid'

class Product extends Component {
    render() {
        return(
            <>
                <div className="product__wrapper">
                    <ProductMedia media={ this.props.product.media }/>
                    <ProductMeta product={ this.props.product } />
                </div>
                <div className="product_reviewsWrapper">
                    <ReviewsGrid />
                </div>
            </>
        )
    }
}

export default Product
